import React, { Component } from "react";
import Cards from "./Cards";
import "./CardList.css";

class CardList extends Component {
  render() {
    const { data } = this.props;

    return (
      <div className="main">
        {data.cards.map((data, i) => (
          <Cards key={i} name={data.title} text={data.text[i]} />
        ))}
      </div>
    );
  }
}

export default CardList;
